webpackJsonp([0xa8def80b207a],{6431:function(e,t){e.exports={data:{post:{html:'<p><a href="http://fifaworldcup.yahoo.com/03/en/t/match/32/index.html"><img alt="weltmeister.jpg" src="http://www.papascott.de/wordpress/wp-content/uploads/2003/10/weltmeister.jpg" width="276" height="400" border="0" /></a></p>\n<p>After defeating the heavily favored US in the semi-finals, Germany won the Women\'s World Cup yesterday, <a href="http://fifaworldcup.yahoo.com/03/en/t/match/32/index.html">defeating Sweden 2-1 in extra time</a> in a very good and close match (broadcast on ARD in prime time Sunday evening). </p>\n<p>Photo stolen from <a title="vowe dot net :: Congratulations, Ladies!" href="http://vowe.net/archives/003684.html">vowe</a>, to whom I say, I can name three players: Prinz, Meinert, Wiegmann.</p>',fields:{title:"Deutschland Weltmeister",date:"13 Oct 2003",url:"https://papascott.de/2003-10-13-deutschland-weltmeister/"}}},pathContext:{slug:"/2003-10-13-deutschland-weltmeister/",prev:{fields:{title:"'Impressum' in English revisited",date:"12 Oct 2003",slug:"/2003-10-12-impressum-in-english-revisited/"}},next:{fields:{title:"",date:"13 Oct 2003",slug:"/2003-10-13-luellau-sturm-gegen-neue-windraeder/"}}}}}});
